var savedDpi1;

var vLedNames = [
    "Logo",
];

var vLedPositions = [

      [1,1]
];

export function Initialize() {
    if(DpiControl) {
        setDpi(dpi1);
    }
}

export function LedNames()
{
    return vLedNames;
}

export function LedPositions()
{
    return vLedPositions;
}

function setDpi(dpi){

    savedDpi1 = dpi;
    var packet = [];
    packet[0] = 0x00;
    packet[1] = 0xD3;
    packet[2] = 0x02;
    packet[3] = 0x00;
    packet[4] = 0x02;
    packet[5] = Math.round(dpi/50);
    device.write(packet, 65);
}
function hexToRgb(hex) {
    var result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
    var colors = [];
    colors[0] = parseInt(result[1], 16);
    colors[1] = parseInt(result[2], 16);
    colors[2] = parseInt(result[3], 16);

    return colors;
}

export function Shutdown()
{
    sendColors(true);
}

export function Validate(endpoint)
{
    return endpoint.interface === 1  && endpoint.usage === 0x0001 && endpoint.usage_page == 0xff01;
}
function sendColors(shutdown = false){
    var packet = []
    
    packet[0x00]   = 0x07;
    packet[0x01]   = 0x0A;
    
    var iX = vLedPositions[0][0];
    var iY = vLedPositions[0][1];


    var color;
    if(shutdown){
        color = hexToRgb(shutdownColor)
    }else if (LightingMode == "Forced") {
        color = hexToRgb(forcedColor)
    }else{
        color = device.color(iX, iY);
    }

    packet[0x02]   = color[0];
    packet[0x03] = color[1];
    packet[0x04]   = color[2];
    packet[0x08] = 0xFF;
    device.send_report(packet, 264);
    device.pause(1);
}

export function Render() {
    sendColors();

    if(savedDpi1 != dpi1 && DpiControl){
        setDpi(dpi1)
    }
}


